response.about:
Косметологические услуги: 
- Чистка лица и спины
- Уход за кожей лица 
- Массаж лица, шеи и декольте;
- Пилинг(коралловый, ретиноловый, кислотный, био-фито);
- Укрепление сосудов, активное омоложение
- Прокол ушей.
- Дарсонвализация;
- Ультразвуковая чистка 
- Ультрафонорез;
- Криолифтинг (криотерапия)

- восковая и сахарная депиляция (усики , руки  ,подмышечные впадины,  ноги до колена , ноги полностью, бикини )

- мезотерапия лица и тела;
- биоревитализация (лицо, шея, декольте, руки);
- биорепарация (лицо, шея, декольте, руки)
